import React from 'react';
import ReactDOM from 'react-dom/client';
import css from "../style.css";
import { Routes, Route, Link } from "react-router-dom";
import logo from '../Images/iiitlogo.jpg'
function Heading() {
    return (
        <div className="HeadingImg">
            <div className="Dflex">
                <div className="classlogo">
                    <img id="classlogo-img" src={logo} alt="logo" />
                </div>
                <ul className="link">
                    <li id="Home">
                        <Link style={{ textDecoration: "none", color: "white" }} to="/">Home</Link>
                    </li>

                    <li id="About">
                        <Link style={{ textDecoration: "none", color: "white" }} to="/about">About</Link>
                    </li>

                    <li id="Club">
                        <Link style={{ textDecoration: "none", color: "white" }} to="/club">Club</Link>
                    </li>
                    <li id="Join">
                        <a href="">
                            Join Classes
                        </a>
                    </li>
                </ul>
            </div>
        </div>
    );
}
export default Heading;
